Ext.define("GS.view.Main", {
    extend: 'Ext.tab.Panel',
    requires: [
        'Ext.TitleBar',
		'Ext.device.Camera',
		'Ext.Button'
    ],
    config: {
        tabBarPosition: 'bottom',
        items: [
            {
                title: 'Welcome',
                iconCls: 'home',

                styleHtmlContent: true,
                scrollable: true,


                html: [
                    "This is a prototype for RAXA patient image module created by NYU.",
					"To take a photograph, tap on the take photo icon below.",
					"Once on the 'Take Photo' tab, tap 'Take Photo'"
                ].join("")
            },
            {
                title: 'Take Photo',
                iconCls: 'action',
                items:[
					{
						xtype: 'button',
						text: 'Take Photo',
						handler: function(){
							Ext.device.Camera.capture({
							    success: function(image) {
									var img = Ext.getCmp('theimage');
									img.setSrc('data:image/jpeg;base64,' +image);
									var json = {"patient":"c2e3895a-fc38-4fed-88a8-1ceb3db62ee9","dataURI":"data:image/jpeg;base64,"};
									Ext.Msg.alert('Title', json.patient);
									Ext.Ajax.request({
						                url: 'http://raxa.io:8080/openmrs/ws/rest/v1/raxacore/image',
						                method: 'POST',
						                disableCaching: false,
						                jsonData: json,
						                headers: Util.getBasicAuthHeaders(),
										success: function (response) {
											Ext.Msg.alert('Title', response);
										},
										failure: function() {
											 Ext.Msg.alert("Error", "Failed to make REST call to ");
										}
						            });
							    },
								failure: function(){
									Ext.Msg.alert('Title', 'failure');
								},
							    quality: 75,
							    width: 200,
							    height: 200,
							    destination: 'data',
							    source: 'camera'
							});
						}
					},
					{
						xtype: 'image',
						height: 300,
						id: 'theimage',
						width: 300,
					}
				]
            }
        ]
    }
});
